import 'bootstrap/dist/css/bootstrap.min.css';
import '../OnBoardingNFT.css';

import img from "../images/imgHorizontal.png";
import N from "../images/Frame.png";


function NovaEconomiaCriativa(){
    return (
        <div class="container-fluid"  >
          <div class="row">
          
            <div class="col-lg-6 col-md-12 col-sm-12">
              <div id="CorpoEsquerdo">
              
                <div><p style={{fontWeight:"700", color:'#A19D9D', fontSize:'18px'}}>APRESENTANDO...</p></div>
                <div>
               

                <img  src={N}class="img-fluid" style={{}} alt=""/>
              
                </div>
                <div id="paragrafo">
                    <h3 style={{fontWeight:"700", color:'#454545', fontSize:'30px'}}>A NOVA ECONOMIA CRIATIVA</h3>

                    <p style={{fontWeight:"400", color:'#454545', fontSize:'22px'}}>Estamos trazendo juntos criadores digitais,<br/> entusiastas de criptomoedas e  colecionadores<br/> para movermos juntos a cultura da nova<br/> economia criativa.
                    </p></div>
                
              </div>
            </div>
            <div class="col-lg-6 col-md-12 col-sm-12"> 
              <div id="Ldireito" >             
                  <img id=""
                        style={{ }}
                        src={img}
                        class="img-fluid"
                        alt="Gotokens"
                        />
                </div>   				
            </div>           
          </div>
        </div>       
    );
}

export default NovaEconomiaCriativa;
